import Slider from '@material-ui/core/Slider'
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button'
import { styled } from '@material-ui/core/styles';
import { useState } from 'react';
import { blue, blueGrey } from '@material-ui/core/colors';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';


const myButtonGroup = styled(ButtonGroup)({
    borderColor: 'white',
    backgroundColor: 'transparent!important',
})

const mySlider = styled(Slider)({
    color: '#0bc5af'
})

const handleClickGo = () => {
    console.log("This is my first function!");
}


function valuetext(value){
    return '{value} min'
}

const Form = ({handleSubmit, handleLevel, handleFocus, level, focus}) => {
    const [absBackgroundColor, setAbsBackgroundColor] = useState('transparent');
    const [cardioBackgroundColor, setCardioBackgroundColor] = useState('transparent');
    const [legsBackgroundColor, setLegsBackgroundColor] = useState('transparent');
    const [fullBackgroundColor, setFullBackgroundColor] = useState('transparent');

    /*const changeButton = () => {
        console.log("function running!")
        if (backgroundColor === 'transparent'){ 
            setBackgroundColor('blueGrey');
        }
        else {
            setBackgroundColor('transparent');
        }
    }*/

    const MyButton = styled(Button)({
        color: 'white',
        borderColor: 'white',
        backgroundColor: 'transparent',
        marginLeft: '10px',
    })

    const handleFocusBtn = (focus) => {
        handleFocus(focus)

        if (focus === 'abs'){
            setAbsBackgroundColor('blue')
            setCardioBackgroundColor('transparent')
            setLegsBackgroundColor('transparent')
            setFullBackgroundColor('transparent')
        }
        else if (focus === 'cardio'){
            setAbsBackgroundColor('transparent')
            setCardioBackgroundColor('blue')
            setLegsBackgroundColor('transparent')
            setFullBackgroundColor('transparent')
        }
        else if (focus === 'legs'){
            setAbsBackgroundColor('transparent')
            setCardioBackgroundColor('transparent')
            setLegsBackgroundColor('blue')
            setFullBackgroundColor('transparent')
        }
        else if (focus === 'fullBody'){
            setAbsBackgroundColor('transparent')
            setCardioBackgroundColor('transparent')
            setLegsBackgroundColor('transparent')
            setFullBackgroundColor('blue')
        }
    }



    return (
        <div className = "form">
            <h2>Focus
                <ButtonGroup aria-label="outlined primary button group" >
                <MyButton className="abs-btn" onClick={() => handleFocusBtn('abs')} style={{backgroundColor: absBackgroundColor}} > Abs </MyButton>
                <MyButton className="cardio-btn" onClick={() => handleFocusBtn('cardio')} style={{backgroundColor: cardioBackgroundColor}}>Cardio</MyButton>
                <MyButton className="legs-btn" onClick={() => handleFocusBtn('legs')} style={{backgroundColor: legsBackgroundColor}}>Legs/Glutes</MyButton>
                <MyButton className="full-btn" onClick={() => handleFocusBtn('fullBody')} style={{backgroundColor: fullBackgroundColor}}> Full Body</MyButton>
                </ButtonGroup>
            </h2>

            <div>{/*
            <h2> Level/Intensity 
                <FormControl variant="outlined" >
                <InputLabel id="demo-simple-select-outlined-label">Level</InputLabel>
                    <Select
                    labelId="demo-simple-select-outlined-label"
                    id="demo-simple-select-outlined"
                    value={level}
                    onChange={handleLevel}
                    label="Age"
                    >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={1}>Beginner</MenuItem>
                    <MenuItem value={2}>Intermediate</MenuItem>
                    <MenuItem value={3}>High</MenuItem>
                    </Select>
                </FormControl>
            </h2>*/
            } </div>

            <h2 style={{marginTop: "38px"}}>Level / Intensity
                <ButtonGroup aria-label="outlined primary button group" >
                <MyButton onClick={() => handleLevel(1)}> Low Impact </MyButton>
                <MyButton onClick={() => handleLevel(1)}> Beginner </MyButton>
                <MyButton onClick={() => handleLevel(2)}> Medium</MyButton>
                <MyButton onClick={() => handleLevel(3)}>High</MyButton>
                </ButtonGroup>
            </h2>


            <h2>Total Time (Minutes)<Slider defaultValue={5} getAriaValueText={valuetext} onChangeCommitted={(e, value)=> handleSubmit(value)} area-labelledby="discrete-slider" valueLabelDisplay="auto" step={5} min={5} max={20} style={{width: "240px", marginLeft:"15px", marginTop:"30px", color: "#06564d"}}
            ></Slider></h2>


            <button className = "challengebutton"> CHALLENGE MODE!</button>
            {/*<button className = "challengebutton" style={{marginTop: "10px"}} onClick={handleSubmit}> Let's Go!</button>*/}
        </div>
      );
}

export default Form;
